import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import {
  IoArrowBack,
  IoAdd,
  IoBook,
  IoPerson,
  IoLayersOutline,
  IoCalendarOutline
} from 'react-icons/io5';
import { UnifiedSearchService } from '../services/unifiedSearchService';
import type { GoogleBookSearchResult } from '../app/services/models/GoogleBookSearchResult';

const GoogleBookDetailPage: React.FC = () => {
  const { googleId } = useParams<{ googleId: string }>();
  const navigate = useNavigate();
  const [book, setBook] = useState<GoogleBookSearchResult | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [adding, setAdding] = useState(false);

  useEffect(() => {
    const fetchBookDetails = async () => {
      if (!googleId) {
        setError('No book ID provided');
        setLoading(false);
        return;
      }

      try {
        // Fetch the book details directly from Google Books API by ID
        const bookDetails = await UnifiedSearchService.getGoogleBookById(googleId);
        setBook(bookDetails);
      } catch (err) {
        console.error('Failed to fetch book details:', err);
        setError('Failed to load book details');
      } finally {
        setLoading(false);
      }
    };

    fetchBookDetails();
  }, [googleId]);

  const handleAddToLibrary = async () => {
    if (!book) return;

    setAdding(true);
    try {
      await UnifiedSearchService.addBookFromGoogle(book.googleId);
      alert('Book added to your library successfully!');
      navigate('/my-books');
    } catch (error) {
      console.error('Failed to add book:', error);
      alert('Failed to add book to your library. It may already exist.');
    } finally {
      setAdding(false);
    }
  };

  const cardStyle = {
    backgroundColor: 'rgba(255, 255, 255, 0.8)',
    backdropFilter: 'blur(10px)',
    borderRadius: '16px',
    border: '1px solid rgba(230, 215, 195, 0.6)',
    boxShadow: '0 4px 12px rgba(75, 63, 48, 0.1)',
    padding: '24px'
  };

  const buttonStyle = {
    backgroundColor: '#D2691E',
    color: 'white',
    fontWeight: 500,
    padding: '12px 24px',
    borderRadius: '8px',
    border: 'none',
    cursor: 'pointer',
    transition: 'background-color 0.2s'
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-vintage-cream flex justify-center items-center">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-orange-600"></div>
      </div>
    );
  }

  if (error || !book) {
    return (
      <div className="min-h-screen bg-vintage-cream p-12">
        <div className="max-w-2xl mx-auto">
          <div className="bg-red-50 border border-red-200 rounded-lg p-4 mb-6">
            <p className="text-red-800">{error || 'Book not found'}</p>
          </div>
          <button
            onClick={() => navigate(-1)}
            className="flex items-center gap-2 bg-white border border-amber-300 text-amber-800 px-4 py-2 rounded-lg hover:bg-amber-50 transition-colors duration-200"
          >
            <IoArrowBack />
            Go Back
          </button>
        </div>
      </div>
    );
  }

  return (
    <div style={{ minHeight: '100vh', backgroundColor: '#FAF3E3' }}>
      {/* Header */}
      <div style={{
        background: 'linear-gradient(90deg, #4B3F30, #5D4A33, #4B3F30)',
        color: 'white',
        padding: '32px 0'
      }}>
        <div style={{ maxWidth: '1200px', margin: '0 auto', padding: '0 24px' }}>
          <Button
            variant="text"
            startIcon={<ArrowBack />}
            onClick={() => navigate(-1)}
            sx={{
              color: 'white',
              marginBottom: '16px',
              '&:hover': {
                backgroundColor: 'rgba(255, 255, 255, 0.1)'
              }
            }}
          >
            Back to Search
          </Button>
          <Typography
            variant="h3"
            sx={{
              fontFamily: 'Playfair Display, serif',
              fontWeight: 700,
              marginBottom: '8px'
            }}
          >
            {book.title}
          </Typography>
          <Typography
            variant="h6"
            sx={{
              color: 'rgba(255, 255, 255, 0.9)',
              fontFamily: 'Inter, sans-serif'
            }}
          >
            by {book.authorName}
          </Typography>
        </div>
      </div>

      {/* Content */}
      <div style={{ maxWidth: '1200px', margin: '0 auto', padding: '48px 24px' }}>
        <div style={{ display: 'grid', gridTemplateColumns: '300px 1fr', gap: '48px' }}>

          {/* Left Column - Book Cover and Actions */}
          <div>
            {/* Book Cover */}
            <div style={{ marginBottom: '24px' }}>
              {book.thumbnailUrl ? (
                <img
                  src={book.thumbnailUrl.replace('&zoom=1', '&zoom=2')} // Higher quality
                  alt={book.title}
                  style={{
                    width: '100%',
                    maxWidth: '300px',
                    height: 'auto',
                    borderRadius: '12px',
                    boxShadow: '0 8px 24px rgba(75, 63, 48, 0.15)'
                  }}
                />
              ) : (
                <div style={{
                  width: '100%',
                  height: '400px',
                  backgroundColor: '#F4E3C1',
                  borderRadius: '12px',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  color: '#6A5E4D',
                  fontSize: '18px'
                }}>
                  <MenuBook style={{ fontSize: '48px', marginBottom: '8px' }} />
                  <br />
                  No Cover Available
                </div>
              )}
            </div>

            {/* Action Button */}
            <Button
              variant="contained"
              size="large"
              fullWidth
              startIcon={<Add />}
              onClick={handleAddToLibrary}
              disabled={adding}
              sx={{
                backgroundColor: '#D2691E',
                color: 'white',
                fontFamily: 'Inter, sans-serif',
                fontWeight: 600,
                padding: '16px',
                borderRadius: '12px',
                fontSize: '16px',
                '&:hover': {
                  backgroundColor: '#B85A1A'
                },
                '&:disabled': {
                  backgroundColor: '#AA814A'
                }
              }}
            >
              {adding ? 'Adding...' : 'Add to My Library'}
            </Button>
          </div>

          {/* Right Column - Book Details */}
          <div>

            {/* Book Information */}
            <Card sx={{ ...cardStyle, marginBottom: '24px' }}>
              <CardContent>
                <Typography
                  variant="h5"
                  sx={{
                    fontFamily: 'Playfair Display, serif',
                    fontWeight: 600,
                    color: '#4B3F30',
                    marginBottom: '24px'
                  }}
                >
                  Book Information
                </Typography>

                <div style={{ display: 'grid', gap: '16px' }}>

                  {/* Author */}
                  <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                    <Person sx={{ color: '#D2691E' }} />
                    <div>
                      <Typography variant="subtitle2" sx={{ color: '#6A5E4D', fontSize: '12px' }}>
                        Author
                      </Typography>
                      <Typography variant="body1" sx={{ color: '#4B3F30', fontWeight: 500 }}>
                        {book.authorName}
                      </Typography>
                    </div>
                  </div>

                  {/* Published Date */}
                  {book.publishedDate && (
                    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                      <CalendarToday sx={{ color: '#D2691E' }} />
                      <div>
                        <Typography variant="subtitle2" sx={{ color: '#6A5E4D', fontSize: '12px' }}>
                          Published
                        </Typography>
                        <Typography variant="body1" sx={{ color: '#4B3F30', fontWeight: 500 }}>
                          {new Date(book.publishedDate).getFullYear()}
                        </Typography>
                      </div>
                    </div>
                  )}

                  {/* Category */}
                  {book.category && (
                    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                      <Category sx={{ color: '#D2691E' }} />
                      <div>
                        <Typography variant="subtitle2" sx={{ color: '#6A5E4D', fontSize: '12px' }}>
                          Category
                        </Typography>
                        <Chip
                          label={book.category}
                          size="small"
                          sx={{
                            backgroundColor: 'rgba(210, 105, 30, 0.1)',
                            color: '#D2691E',
                            fontWeight: 500
                          }}
                        />
                      </div>
                    </div>
                  )}

                  {/* ISBN */}
                  {book.isbn && (
                    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                      <MenuBook sx={{ color: '#D2691E' }} />
                      <div>
                        <Typography variant="subtitle2" sx={{ color: '#6A5E4D', fontSize: '12px' }}>
                          ISBN
                        </Typography>
                        <Typography variant="body1" sx={{ color: '#4B3F30', fontWeight: 500 }}>
                          {book.isbn}
                        </Typography>
                      </div>
                    </div>
                  )}

                </div>
              </CardContent>
            </Card>

            {/* Description */}
            {book.description && (
              <Card sx={cardStyle}>
                <CardContent>
                  <Typography
                    variant="h5"
                    sx={{
                      fontFamily: 'Playfair Display, serif',
                      fontWeight: 600,
                      color: '#4B3F30',
                      marginBottom: '16px'
                    }}
                  >
                    Description
                  </Typography>
                  <Typography
                    variant="body1"
                    sx={{
                      color: '#4B3F30',
                      lineHeight: 1.7,
                      fontSize: '16px'
                    }}
                  >
                    {book.description}
                  </Typography>
                </CardContent>
              </Card>
            )}

          </div>
        </div>
      </div>
    </div>
  );
};

export default GoogleBookDetailPage;
